import React from 'react';
import {Form, Input, Modal} from "antd";

const FormItem = Form.Item;

const layout = {
    labelCol: { span: 7 },
    wrapperCol: { span: 13 },
};

interface Interface {
    visible: boolean
}

const Index: React.FC<Interface> = (props) => {
    const {visible} = props;
    const [form] = Form.useForm();

    return (
        <Modal
            title={'配置'}
            visible={visible}
        >
            <Form {...layout} form={form}>
                <FormItem
                    name={'code'}
                    label={'代码'}
                    rules={[{ required: true, message: '不能不填哦' }]}
                >
                    <Input/>
                </FormItem>
                <FormItem
                    name={'ave_price'}
                    label={'成本价'}
                    rules={[{ required: true, message: '不能不填哦' }]}
                >
                    <Input/>
                </FormItem>
                <FormItem
                    name={'share'}
                    label={'份额'}
                >
                    <Input/>
                </FormItem>
            </Form>
        </Modal>
    );
}

export default Index
